import React, { Component } from 'react';

export default class Header extends Component {
    render() {
        
      return ( 
<header>
    <Row>
        <Col>
        Widgets
        </Col>
        <Col>
        Data Form
        </Col>
    </Row>
</header>
     );
    }
  }
